int32_t test_lcd_show_color(int argc, char* argv[])
{ 
    lcd_color_show(LCD_COLOR_WHITE);
    osDelay(200);
    lcd_color_show(LCD_COLOR_BLACK);  
    osDelay(200); 
    lcd_color_show(LCD_COLOR_BLUE);  
    osDelay(200); 
    lcd_color_show(LCD_COLOR_BRED);   
    osDelay(200);  
    lcd_color_show(LCD_COLOR_GRED);  
    osDelay(200);   
    lcd_color_show(LCD_COLOR_GBLUE); 
    osDelay(200);   
    lcd_color_show(LCD_COLOR_RED);  
    osDelay(200);   
    lcd_color_show(LCD_COLOR_MAGENTA); 
    osDelay(200); 
    lcd_color_show(LCD_COLOR_GREEN);  
    osDelay(200); 
    lcd_color_show(LCD_COLOR_CYAN);
    osDelay(200);  
    lcd_color_show(LCD_COLOR_YELLOW);  
    osDelay(200);  
    lcd_color_show(LCD_COLOR_BROWN);  
    osDelay(200); 
    lcd_color_show(LCD_COLOR_BRRED);  
    osDelay(200); 
    lcd_color_show(LCD_COLOR_GRAY); 
    osDelay(200);
    
    return ERR_OK;
}

int32_t test_lcd_show_picture(int argc, char* argv[])
{ 
    struct lcd_rect rect;

    rect.start.x = 0;
    rect.start.y = 0; 
    rect.end.x = 128;
    rect.end.y = 160;


    lcd_view_port_show(&rect, (uint16_t*)gImage_128x160);
    osDelay(1000);

    

    rect.start.x = 0;
    rect.start.y = 0; 
    rect.end.x = 139;
    rect.end.y = 48;
    
    lcd_view_port_show(&rect, (uint16_t*)_aclogo);
    osDelay(1000);

    return 0;
}





